import { Window, App } from "proton-native"; // import the proton-native components
import { useInterval, isEmpty } from "./components/tools"
const axios = require('axios');
const minSize = { width: 500, height: 800 };
const cardData = require("./components/card_data.json")


export default class Example extends Component {
  render() {
    // all Components must have a render method
    return (
      <App>
        {/* you must always include App around everything */}
        <Window style={{ width: 300, height: 300 }}>
          <View></View>
        </Window>
      </App>
    );
  }
}
